import React from "react";
import { useNavigate } from "react-router-dom";

export default function Sidebar() {
  const navigate = useNavigate();

  return (
    <aside className="sidebar">
      <h2>Municipal Dashboard</h2>

      <nav>
        <a onClick={() => navigate("/map")}>Map</a>

        {/* UI shows Reports, route remains /complaints */}
        <a onClick={() => navigate("/complaints")}>Reports</a>

        <a onClick={() => navigate("/analytics")}>Analytics</a>
        <a onClick={() => navigate("/staff")}>Staff</a>
        <a onClick={() => navigate("/settings")}>Settings</a>
      </nav>
    </aside>
  );
}
